import React from "react";
import "./Home.css";
import { Header } from "../components"
import BackgroundImage from "../Image/BackgroundImage.jpg";

class Home extends React.Component {
  render() {
    return (
      <>
       <Header />
        <img src={BackgroundImage}></img>
      </>
    );
  }
}
export default Home;
